import Navbar from './Navbar';
import './Blog.css';

function Blog() {
  const blogs = [
    {
      id: 1,
      title: 'Mumbai',
      content: 'This is the content of the first blog...',
      Image: '/mumbai.jpeg',
      shape: 'square',
    },
    {
      id: 2,
      title: 'Delhi',
      content: 'This is the content of the second blog...',
      shape: 'rectangle',
    },
        {
      id: 4,
      title: 'Goa',
      content: 'Explore a five day itenirary in Goa',
      image: '',
      shape: 'square',
    },
    {
      id: 5,
      title: 'Kashmir',
      content: 'This is the content of the second blog...',
      shape: 'rectangle',
    },
    {
      id: 3,
      title: 'Kerela',
      content: 'Explore a five day itenirary in Kerela',
      image: '/kerela.jpeg',
      shape: 'tallrect',
    },

    {
      id: 6,
      title: 'Gujarat',
      content: 'This is the content of the first blog...',
      shape: 'square',
    },
  ];

  return (
    <div>
      <Navbar />
    <div className="blog-container">
      {blogs.map((blog) => (
        <div key={blog.id} className={`blog ${blog.shape}`}>
          <h2>{blog.title}</h2>
          <p>{blog.content}</p>
        </div>
      ))}
    </div>
    </div>
  );
}

export default Blog;
